    <style>
        * { margin: 0; padding: 0; box-sizing: border-box; }
        body {
            font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
            background: #1a1a2e;
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
            overflow: hidden;
            position: relative;
        }
        
        /* Simple background gradient */
        .bg-gradient {
            position: fixed;
            width: 100%;
            height: 100%;
            top: 0;
            left: 0;
            background: linear-gradient(135deg, rgba(62, 98, 220, 0.1) 0%, rgba(255, 107, 53, 0.1) 100%);
            z-index: 0;
        }
        

        .container {
            background: #2a2a3e;
            padding: 50px 70px;
            border-radius: 16px;
            border: 1px solid #4a4a5e;
            box-shadow: 0 10px 30px rgba(0,0,0,0.5);
            text-align: center;
            max-width: 520px;
            position: relative;
            z-index: 10;
        }
        
        /* Music note icon */

            width: 90px;
            height: 90px;
            margin: 0 auto 30px;
            border-radius: 50%;
            display: flex;
            align-items: center;
            justify-content: center;
            position: relative;
        }
